eureka:
  client:
    serviceUrl:
      defaultZone: http://localhost:8761/eureka/
    fetch-registry: false
    register-with-eureka: false
server:
  port: 8888

spring:
  cloud:
    config:
      server:
        git:
          uri: https://github.com/Umikelgy/spring-cloud-dev.git
          searchPaths: untitled
          force-pull: true
  application:
    name: config-serve